script: |
  super -f text -I q5984.spq | sort > q5984.out

inputs:
  - name: q5984.spq
    data: |
      SELECT col0 / ( cor0.col1 * col1 ) - + ( + ( + cor0.col0 ) ) * + 32 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q5984.out
    data: |
      -2048
      -2560
      -96
